import React from 'react';

const NavigationBar = (props) => {


    let data = {
        category: 'Visual Arts',
        subcat: 'Painting',
        title: 'A Scene'

    }

    return (
        <div>
            {this.props.category} / {this.props.subcat} / {this.props.title}
        </div>
    );
};

export default NavigationBar;
